import { Fragment } from "react";
import {Link} from "react-router-dom"
const DUMMY_EVENTS = [
  {
    id: "e1",
    title: "some event",
  },
  {
    id: "e2",
    title: "every event",
  },
];

const EventsPage = () => {
  return (
    <Fragment>
        <h1> EventsPage</h1>
        <ul>
            {DUMMY_EVENTS.map((event)=><li key={event.id}>
                <Link to={``}></Link>
            </li>)}

        </ul>
    </Fragment>
  )
};

export default EventsPage;
